var n=(0,t.createTemplateFactory)({id:"Zy775rd7",block:'[[[10,"h3"],[12],[1,"Introduction to ember-concurrency"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  To demonstrate the kinds of problems ember-concurrency\\n  is designed to solve, we\'ll first implement a basic example of\\n  loading data in a Component using only core Ember APIs. Then\\n  we\'ll introduce ember-concurrency tasks as part of a refactor.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  This tutorial (and ember-concurrency itself) assumes that you have\\n  reasonable familiarity with Ember\'s core APIs, particularly surrounding\\n  Components, templates, actions, Promises, and the use of "],[10,"code"],[12],[1,"async/await"],[13],[1,".\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  For our use case, we\'re going to implement a Component that\\n  fetches and displays nearby retail stores. This involves\\n  a two-step asynchronous process:\\n"],[13],[1,"\\n\\n"],[10,"ol"],[12],[1,"\\n  "],[10,"li"],[12],[1,"\\n    It uses geolocation to find the user\'s latitude/longitude coordinates, and then:\\n  "],[13],[1,"\\n  "],[10,"li"],[12],[1,"\\n    It forwards those coordinates to the server to fetch a list of nearby restaurants.\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"em"],[12],[1,"\\n    This is basically the same example demonstrated in this\\n    "],[10,3],[14,6,"https://youtu.be/VEzVDOmY-dc?t=123"],[12],[1,"EmberConf ember-concurrency talk"],[13],[1,";\\n    take a look if you prefer a video alternative to this tutorial. Please note,\\n    though, that the coding style has since changed with Ember Octane. The\\n    examples below have been updated to reflect the newer syntax.\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[10,"h4"],[12],[1,"Version 1: Bare Minimum Implementation"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  We\'ll start off a bare-bones implementation of the feature: within\\n  an action called "],[10,"code"],[12],[1,"findStores"],[13],[1,", we\'ll create an async function that\\n  fetches the coordinates from a geolocation service\\n  and passes those coordinates to a store\'s "],[10,"code"],[12],[1,"getNearbyStores"],[13],[1,"\\n  method, which eventually gives us an array of stores that we stash\\n  on the "],[10,"code"],[12],[1,"result"],[13],[1," property so that the stores can be displayed\\n  in the template.\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@codeSnippet","@templateSnippet"],["better-syntax-1.js","better-syntax-1.hbs"]],null],[1,"\\n"],[8,[39,1],null,null,null],[1,"\\n\\n"],[10,2],[12],[1,"\\n  This first implementation "],[10,"em"],[12],[1,"works"],[13],[1,", but it\'s not really production-ready.\\n  The most immediate problem is that there\'s no loading UI; the user clicks\\n  the button and it seems like nothing is happening until the results come back.\\n"],[13],[1,"\\n\\n"],[10,"h4"],[12],[1,"Version 2: Add a Loading Spinner"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  We\'d like to display a loading spinner while the code is fetching nearby stores.\\n  In order to do this, we\'ll add an "],[10,"code"],[12],[1,"isFindingStores"],[13],[1," property to the\\n  component that the template can use to display a spinner.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  "],[10,"em"],[12],[1,"\\n    We\'ll use "],[10,"code"],[12],[1,"++"],[13],[1," comments to highlight newly added code.\\n  "],[13],[1,"\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@codeSnippet","@templateSnippet"],["better-syntax-2.js","better-syntax-2.hbs"]],null],[1,"\\n"],[8,[39,2],null,null,null],[1,"\\n\\n"],[10,2],[12],[1,"\\n  This is certainly an improvement, but strange things start to happen if you\\n  click the \\"Find Nearby Stores\\" button many times in a row.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The problem is that we\'re kicking off multiple concurrent attempts to fetch\\n  nearby locations, when really we just want only one fetch to be running\\n  at any given time.\\n"],[13],[1,"\\n\\n"],[10,"h4"],[12],[1,"Version 3: Preventing Concurrency"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  We\'d like to prevent another fetch from happening if one is already in\\n  progress. To do this, just need to add a check to see if\\n  "],[10,"code"],[12],[1,"isFindingStores"],[13],[1," is true, and return early if so.\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@codeSnippet","@templateSnippet"],["better-syntax-3.js","better-syntax-3.hbs"]],null],[1,"\\n"],[8,[39,3],null,null,null],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Now it is safe to tap the \\"Find Nearby Stores\\" button. Are we done?\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Unfortunately, no. There\'s an important corner case we haven\'t addressed yet:\\n  if the component is destroyed (because the user navigated\\n  to a different page) while the fetch is running, our code\\n  will throw an Error with the message\\n  "],[10,"code"],[12],[1,"\\"calling set on destroyed object\\""],[13],[1,".\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  You can\\n  actually verify that this happening by opening your browser\'s\\n  web inspector, clicking \\"Find Nearby Stores\\" from the example\\n  above, and then quickly clicking "],[8,[39,4],null,[["@route"],["docs.introduction"]],[["default"],[[[[1,"this link"]],[]]]]],[1,"\\n  before the store results have come back.\\n"],[13],[1,"\\n\\n"],[10,"h4"],[12],[1,"Version 4: Handling \\"set on destroyed object\\" errors"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  The problem is that it\'s possible for our promise callback (the\\n  one that sets "],[10,"code"],[12],[1,"result"],[13],[1," and "],[10,"code"],[12],[1,"isFindingStores"],[13],[1,")\\n  to run after the component has been destroyed, and Ember (and React\\n  and many others) will complain if you try and, well, call "],[10,"code"],[12],[1,"set()"],[13],[1,"\\n  on a destroyed object.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Fortunately, Ember let\'s us check if an object has been destroyed\\n  via the "],[10,"code"],[12],[1,"isDestroyed"],[13],[1," flag, so we can just add a bit of\\n  defensive programming to our promise callback as follows:\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@codeSnippet","@templateSnippet"],["better-syntax-4.js","better-syntax-4.hbs"]],null],[1,"\\n"],[8,[39,5],null,null,null],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Now if you click \\"Find Nearby Stores\\" and\\n  "],[8,[39,4],null,[["@route"],["docs.introduction"]],[["default"],[[[[1,"navigate elsewhere"]],[]]]]],[1,", you won\'t see\\n  that pesky error.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Now, are we done?\\n"],[13],[1,"\\n\\n"],[10,"h4"],[12],[1,"Version 5: Handle Promise/Async Function Rejection"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  You might have noticed that we don\'t have any error handling if\\n  either the "],[10,"code"],[12],[1,"getCoords"],[13],[1," or "],[10,"code"],[12],[1,"getNearbyStores"],[13],[1,"\\n  "],[10,"code"],[12],[1,"await"],[13],[1," calls throw an error.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Even if we were too lazy to build\\n  an error banner or popup to indicate that something went wrong (and we are),\\n  the least we could do is make sure that our code gracefully\\n  recovers from such an error and doesn\'t wind up in a bad state.\\n  As it stands, if one of those "],[10,"code"],[12],[1,"await"],[13],[1," calls raises an error,\\n  "],[10,"code"],[12],[1,"isFindingStores"],[13],[1," would be stuck to "],[10,"code"],[12],[1,"true"],[13],[1,", and\\n  there\'d be no way to try fetching again.\\n"],[13],[1,"\\n\\n"],[10,2],[12],[1,"\\n  Let\'s use a "],[10,"code"],[12],[1,"finally"],[13],[1," block to make sure that\\n  "],[10,"code"],[12],[1,"isFindingStores"],[13],[1," always gets set to "],[10,"code"],[12],[1,"false"],[13],[1,",\\n  regardless of success or failure. Unfortunately, this also\\n  means we have to duplicate our "],[10,"code"],[12],[1,"isDestroyed"],[13],[1," check.\\n"],[13],[1,"\\n\\n"],[8,[39,0],null,[["@codeSnippet","@templateSnippet"],["better-syntax-5.js","better-syntax-5.hbs"]],null],[1,"\\n"],[8,[39,6],null,null,null],[1,"\\n\\n"],[10,2],[12],[1,"\\n  And there you have it: a reasonably-production ready implementation\\n  of finding nearby stores.\\n"],[13],[1,"\\n"]],[],false,["code-template-toggle","tutorial-0","tutorial-1","tutorial-2","link-to","tutorial-3","tutorial-4"]]',moduleName:"dummy/docs/tutorial/index/template.hbs",isStrictMode:!1})
